import './App.css';
import Views from './Views/Views';
import Navbar from './components/Navbar';

function App() {
  const adminUser = {
    email: "admin@admin.com",
    password: "admin123"
  }

  const [user, setUser] = useState({
    name: "",
    email: ""
  });
  const [error, setError] = useState("");

  return (
    <div className="App">
      <Navbar />
      <Views />
    </div>
  );
}

export default App;
